A cross-function reentrancy attack is a more complex version of the same process. Cross-function reentrancy occurs when a vulnerable function shares state with a function that an attacker can exploit. // UNSECURE
function transfer(address to, uint amount) external { if (balances[msg.sender] >= amount) { balances[to] += amount; balances[msg.sender] -= amount; }
} function withdraw() external { uint256 amount = balances[msg.sender]; (bool success,) = msg.sender.call{value: balances[msg.sender]}(""); require(success); balances[msg.sender] = 0;
} In this example, a hacker can exploit this contract by having a fallback function call transfer() to transfer spent funds before the balance is set to 0 in the withdraw() function.

